import Tile from "./Tile";
import './TileGrid.module.css';



// should take in props so it can be customized for different uses
export default function TileGrid() {
  // do stuff to set up <Tile> compon.s grid of tiles :P
  let counter = 0;

  const listOfAnimeTitles = ["Sup", "Hello", "How goes it"];
  let listOfTiles = [];

  listOfAnimeTitles.forEach((currTitle) => {
    listOfTiles[counter] = <Tile name={currTitle} />
    ++counter;
  })

  return (
    <div style={{ display: 'flex' }}>
      {listOfTiles}
    </div>
  )
}
